import styles from './resource.css';
import React  from 'react';
import { Link ,Outlet } from 'react-router-dom';


function Resource(){
    return (
        <div>
            <div className="menu">
                <Link to='management'>课程管理</Link>
                <Link to='resource'>资源管理</Link>
            </div>

            <div class="resource-list" id="resource-list">
                <div class="resource-card question-type" data-name="选择题 1" data-keyword="数学" data-source="教材A" data-visibility="课程1">
                    <div class="resource-info">
                        <span class="resource-title">选择题 1</span>
                        <span class="resource-source">来源: 教材A</span>
                    </div>
                </div>
            </div>
            <Outlet />
        </div>
    )
}

export default Resource;
